import { useParams ,Route} from "react-router-dom";
import { Fragment } from "react";
import Comments from '../components/comments/Comments'
const QuoteDetail = () =>{
    const params=useParams();
    return(
        <Fragment>
        <h1>Quote Detail</h1>
        <p>{params.quoteId}</p>
        <Route path={`/quotes/${params.q}`}></Route>
        </Fragment>
    )
}
export default QuoteDetail;
